import React, { Component } from 'react';
//import { Button, View, Text } from 'react-native';
import { createStackNavigator, createAppContainer } from 'react-navigation';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  render() {
    return (
      <div className="App">
        <header className="App-header">
        <a
            //className="App-link"
            //href="https://reactjs.org"
            //target="_blank"
            //rel="noopener noreferrer"
          >
            Weather Forecast
            <p>Enter a zipcode below to get the current weather for that area</p>
          </a>
          <img src={logo} className="App-logo" alt="logo" />
          <p className = "Enter-details">
            <form>
              <input type="text" name="postalcode" placeholder="Enter Postal Code"></input>
              {this.renderRedirect()}
              <button title="Enter postal code"
                  onPress={() => this.props.navigation.navigate('Details')}></button>
            </form>
          </p>
        </header>
      </div>
    );
  }
}

export default App;
